import React, {Fragment} from "react";
import Table from "react"
import ShiftTable from "./ShiftTable/ShiftTable";


const DisplayShifts = (props) => {


    return (
        <Fragment>
            {props.getAllShiftsProperty &&
                props.getAllShiftsProperty.map((shift, index) => {
                    return(
                        <Table>
                            <thead>
                                <tr>
                                    <th>Shift</th>
                                    <th>Start Time</th>
                                    <th>End Time</th>
                                    <th>Certification Requiried</th>
                                    <th>Assigned Nurse</th>
                                </tr> 
                            </thead>
                            <tbody>
                                <tr>
                                    <td>{shift.name}</td>
                                    <td>{shift.start}</td>
                                    <td>{shift.end}</td>
                                    <td>{shift.qual_required}</td>
                                    <td>{shift.nurse_id}</td>
                                </tr>
                            </tbody>
                        </Table>
                    )
                    }
            )}
        </Fragment> 
    );
}
 
export default DisplayShifts;
